import "./Search.css";
// import icon_back from "../img/icon/header_back.png";
// import { useNavigate } from "react-router-dom";
import icon_search from "../img/icon/searchbar_search.png";
import { useState } from "react";

const Search = ({onSubmit}) => {
    // const navigate = useNavigate();
    const [search, setSearch] = useState("");
    const onChangeSearch = (e) => {
        setSearch(e.target.value);
    };
    const onKeyDown = (e) => {
        if(e.keyCode === 13){
            if(search !== ""){
                onSubmit(search);
            }
        }
    }

    // const goBack = () => {
    //     navigate(-1);
    // }

    return(
        <div className="Search">
            <div className="contents_top">
                {/* <button className="btn_back" onClick={goBack}><img alt="back" src={icon_back}/></button> */}
                <div className="search_bar_wrapper">
                <img className="icon_search" alt="search" src={icon_search}/>
                <input 
                    className="search_bar" 
                    value={search}
                    onChange={onChangeSearch}
                    onKeyDown={onKeyDown}
                    placeholder="검색어를 입력하세요"
                />
            </div>
            </div>
            <div className="contents_top">
                <div className="left">
                    <h1>최근 검색어</h1>
                </div>
                <div className="right">
                    <button className="btn_delete">전체 삭제</button>
                </div>
            </div>
            <div className="list_wrapper">

            </div>
        </div>
    );
}

export default Search;
